  "inlineSchema": "// prisma/schema.prisma\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"mysql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// --- UTILISATEURS ---\nmodel User {\n  id          String   @id @default(uuid())\n  email       String   @unique\n  password    String\n  firstName   String\n  lastName    String\n  phone       String?\n  role        Role     @default(WORKER)\n  jobTitle    String? // Ex: Maçon, Architecte, Comptable\n  isSuspended Boolean  @default(false)\n  createdAt   DateTime @default(now())\n\n  // Relations\n  // Ajoute cette ligne pour la relation inverse :\n  workingOnProjects Project[]       @relation(\"ProjectWorkers\")\n  managedProjects   Project[]       @relation(\"ProjectManager\")\n  assignedTasks     Task[]          @relation(\"AssignedTo\")\n  reports           DailyReport[] // Les rapports qu'il a écrits\n  logs              ActivityLog[]\n  // --- AJOUTE CETTE LIGNE ICI ---\n  supplyRequests    SupplyRequest[]\n  // --- AJOUTE CETTE LIGNE ICI ---\n  connectionLogs    ConnectionLog[]\n}\n\nmodel Project {\n  id          String        @id @default(uuid())\n  code        String?       @unique\n  name        String\n  description String?       @db.Text\n  status      ProjectStatus @default(PENDING)\n\n  // --- 1. INFORMATIONS GÉNÉRALES ---\n  projectType String // Résidentiel, Commercial...\n  objective   String? // Habitation, Location, Vente...\n  urgency     String? // Immédiat, 3-6 mois...\n\n  // --- 2. FONCIER & LOCALISATION ---\n  location    String // Ville / Quartier\n  surface     Float? // m²\n  landStatus  String? // Nu, Bâti...\n  legalStatus String? // Titre Foncier, Bail, Délibération... (CRUCIAL SN)\n  isOwner     Boolean @default(false)\n\n  // --- 3. URBANISME & ACCÈS ---\n  zoneType   String? // Urbaine, Rurale...\n  accessType String? // Goudron, Piste, Sablonneux...\n  utilities  String? // JSON stringify : [\"Eau\", \"Elec\", \"Senelec\"]\n\n  // --- 4. BÂTIMENT & TECHNIQUE ---\n  buildingType String? // Villa, R+1, R+4...\n  floors       Int?    @default(1)\n  units        Int?    @default(1) // Nbr logements\n  hasElevator  Boolean @default(false)\n  soilStudy    Boolean @default(false) // Étude de sol faite ?\n\n  // --- 5. FINITIONS & BUDGET ---\n  standing  String? // Eco, Standard, Haut Standing\n  budget    Float     @default(0.0)\n  startDate DateTime?\n\n  // --- 6. CLIENT ---\n  clientPhone String? // Contact rapide\n  contactPref String? // Whatsapp, Appel...\n\n  managerId String?\n  manager   User?   @relation(\"ProjectManager\", fields: [managerId], references: [id])\n\n  // Liaison Client (via l'ID user qui a créé)\n  clientId String?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  tasks     Task[]\n  reports   DailyReport[]\n  documents Document[]\n  materials MaterialOrder[]\n  // Ajoute cette ligne pour lister les ouvriers du chantier :\n  workers   User[]          @relation(\"ProjectWorkers\")\n  progress  Int             @default(0) // Pourcentage d'avancement (ex: 45)\n\n  // --- AJOUTE CES DEUX LIGNES ICI ---\n  inventory      InventoryItem[]\n  supplyRequests SupplyRequest[]\n}\n\n// --- TÂCHES & SUIVI ---\nmodel Task {\n  id          String     @id @default(uuid())\n  title       String\n  description String?    @db.Text\n  status      TaskStatus @default(TODO)\n  priority    Priority   @default(MEDIUM)\n  dueDate     DateTime?\n\n  projectId String\n  project   Project @relation(fields: [projectId], references: [id], onDelete: Cascade)\n\n  assignedToId String?\n  assignedTo   User?   @relation(\"AssignedTo\", fields: [assignedToId], references: [id])\n\n  createdAt DateTime @default(now())\n}\n\n// --- RAPPORTS JOURNALIERS (Le journal de bord du chantier) ---\n\nmodel DailyReport {\n  id      String  @id @default(uuid())\n  content String  @db.Text\n  weather String?\n\n  // NOUVEAU : Stockage des fichiers (JSON: [{url, type}, ...])\n  media Json?\n\n  // NOUVEAU : Statut de lecture par le manager\n  status ReportStatus @default(PENDING)\n\n  projectId String\n  project   Project @relation(fields: [projectId], references: [id], onDelete: Cascade)\n\n  authorId String\n  author   User   @relation(fields: [authorId], references: [id])\n\n  createdAt DateTime @default(now())\n}\n\n// --- GESTION MATÉRIAUX & DOCUMENTS ---\nmodel MaterialOrder {\n  id           String      @id @default(uuid())\n  supplier     String\n  items        Json // Liste: [{nom: \"Ciment\", qte: 50, prix: 5000}]\n  totalCost    Float\n  status       OrderStatus @default(PENDING)\n  deliveryDate DateTime?\n\n  projectId String\n  project   Project @relation(fields: [projectId], references: [id])\n}\n\nmodel Document {\n  id   String  @id @default(uuid())\n  name String\n  url  String\n  type DocType @default(OTHER) // PLAN, INVOICE, CONTRACT\n\n  projectId String\n  project   Project @relation(fields: [projectId], references: [id])\n\n  createdAt DateTime @default(now())\n}\n\nmodel ActivityLog {\n  id        String   @id @default(uuid())\n  action    String\n  userId    String\n  user      User     @relation(fields: [userId], references: [id])\n  timestamp DateTime @default(now())\n}\n\n// ...\n\nmodel ContactRequest {\n  id        String @id @default(uuid())\n  firstName String\n  lastName  String\n  email     String\n  phone     String\n\n  // Localisation\n  location  String? // Adresse écrite\n  latitude  Float? // GPS Auto\n  longitude Float? // GPS Auto\n\n  // Catégorisation\n  subject ContactSubject\n  message String         @db.Text\n\n  status    ContactStatus @default(NEW)\n  createdAt DateTime      @default(now())\n}\n\n// --- STOCK SUR LE CHANTIER ---\nmodel InventoryItem {\n  id           String  @id @default(uuid())\n  name         String\n  category     String?\n  quantity     Int\n  unit         String\n  minThreshold Int\n\n  projectId String\n  project   Project @relation(fields: [projectId], references: [id], onDelete: Cascade)\n\n  updatedAt DateTime @updatedAt\n}\n\n// --- DEMANDES D'APPROVISIONNEMENT ---\nmodel SupplyRequest {\n  id       String        @id @default(uuid())\n  itemName String\n  quantity Int\n  unit     String\n  urgency  Priority      @default(MEDIUM)\n  status   RequestStatus @default(PENDING)\n  note     String?\n\n  projectId String\n  project   Project @relation(fields: [projectId], references: [id], onDelete: Cascade)\n\n  requesterId String\n  requester   User   @relation(fields: [requesterId], references: [id])\n\n  createdAt DateTime @default(now())\n}\n\n// ...\n\nmodel ConnectionLog {\n  id String @id @default(uuid())\n\n  // Qui ?\n  userId String\n  user   User   @relation(fields: [userId], references: [id])\n\n  // Quoi ?\n  deviceModel String? // Ex: iPhone 14, Samsung S21\n  os          String? // Ex: iOS, Android, Windows\n  browser     String? // Ex: Chrome, Safari\n\n  // Comment ?\n  networkType String? // Ex: wifi, 4g, 3g\n  ipAddress   String? // IP Publique\n\n  // Où ?\n  latitude  Float?\n  longitude Float?\n  location  String? // Adresse approximative (si dispo)\n\n  // Quand ?\n  connectedAt DateTime @default(now())\n}\n\nenum RequestStatus {\n  PENDING\n  ORDERED\n  DELIVERED\n  REJECTED\n}\n\nenum ContactSubject {\n  RECLAMATION\n  RENDEZ_VOUS\n  AUTRE\n}\n\nenum ContactStatus {\n  NEW\n  READ\n  ARCHIVED\n}\n\n// --- ENUMS (Listes de choix) ---\nenum Role {\n  ADMIN // DG, Superviseur général\n  MANAGER // Chef de chantier, Ingénieur\n  WORKER // Ouvrier, Technicien\n  CLIENT // Le client final\n  SUPPLIER // Fournisseur\n}\n\nenum ProjectStatus {\n  PENDING // En attente de validation\n  PLANNED\n  IN_PROGRESS\n  PAUSED\n  COMPLETED\n  CANCELLED\n}\n\nenum TaskStatus {\n  TODO\n  IN_PROGRESS\n  BLOCKED\n  DONE\n}\n\nenum Priority {\n  LOW\n  MEDIUM\n  HIGH\n  CRITICAL\n}\n\nenum OrderStatus {\n  PENDING\n  APPROVED\n  DELIVERED\n  CANCELLED\n}\n\nenum DocType {\n  PLAN\n  CONTRACT\n  INVOICE\n  REPORT\n  OTHER\n}\n\n// Ajouter le statut dans l'enum existant ou en créer un nouveau\nenum ReportStatus {\n  PENDING // Envoyé, pas encore vu\n  REVIEWED // Vu par le manager\n}\n",
